https://query.wikidata.org/sparql.query:
SELECT ?item ?itemLabel ?geo WHERE {
?item wdt:P31 wd:Q867738 .
 ?item wdt:P625 ?geo .
 SERVICE wikibase:label {
 bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en".
 }
 } LIMIT 10

